def upload_image(data):
    path = os.path.abspath(__file__)
    path = path.rsplit('/apps/', 1)[0]


    # file = ""
    with open("imageToSave.png", "wb") as fh:
        byte_file = data.get("employee_face_image")
        file = base64.b64decode(byte_file)

    actual_file = Image.open(BytesIO(file))
    file_name = data.get("employee_id").replace("-","") + str(data.get("date").replace("-","")) + str(data.get("time").replace(":",""))
    actual_file.save(frappe.get_site_path() + "/public" + "/files/" + file_name +".jpeg", quality=95)
    picture_of_me = face_recognition.load_image_file(frappe.get_site_path() + "/public" + "/files/" + file_name +".jpeg")
    if len(face_recognition.face_encodings(picture_of_me)) == 0:
        rotate_image(frappe.get_site_path() + "/public" + "/files/" + file_name +".jpeg")
    return "/public" + "/files/" + file_name +".jpeg"
    # user_.user_image = "/files/" + file_name +".jpeg"
    # user_.save()


def check_image(unknown_image=None, uploaded_image=None):
    frappe.log_error(unknown_image, "Unknow Image")
    frappe.log_error(uploaded_image, "Uploaded Image")
    frappe.log_error(frappe.get_site_path() + unknown_image, "Path of Unknown Image")
    picture_of_me = face_recognition.load_image_file(frappe.get_site_path() + unknown_image)
    frappe.log_error(str(picture_of_me), "Picture of me")

    my_face_encoding = face_recognition.face_encodings(picture_of_me)[0]

    # my_face_encoding now contains a universal 'encoding' of my facial features that can be compared to any other picture of a face!

    unknown_picture = face_recognition.load_image_file(frappe.get_site_path() + "/public/" + uploaded_image)
    unknown_face_encoding = face_recognition.face_encodings(unknown_picture)[0]

    # Now we can see the two face encodings are of the same person with `compare_faces`!

    results = face_recognition.compare_faces([my_face_encoding], unknown_face_encoding,tolerance=0.54)
    frappe.log_error(str(results),"Result")
    print(results)
    return results[0]



